    data: |
      SELECT + 94 / ( cor0.col0 ) AS col2 FROM tab2 (FORMAT parquet), tab0 (FORMAT parquet) cor0;
  - name: tab0
  - name: tab2

outputs:
  - name: q4256.out
    data: |
      1
      1
      1
      2
      2
      2
      3
      3
      3
